import React, { useState } from "react";
import BookItem from "./BookItem";

const List = (props) => {

    const [books, setBooks] = useState([]);

    return (
        <ul>
            {props.items.map((books) => (
                <BookItem
                    key={books.id}
                    title={books.title}
                    author={books.author}
                    publicationDate={books.publicationDate}
                    genre={books.genre} 
                />
            ))}
        </ul>
    );
}

export default List;
